import React from 'react';
import TableWidget from '../widgets/TableWidget'
function createData(name, age, phone, email, company, registeredevents=1) {
    return { name, age, phone, email, company, registeredevents };
  }
  
  const rows = [
    createData('Cupcake', 25, '123456789', 'example@gmail.com', 'spectrum Global',2),
    createData('Donut', 30, '123456789', 'example@gmail.com', 'spectrum Global', 2),
    createData('Eclair', 35, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createData('Frozen yoghurt', 29, '123456789', 'example@gmail.com', 'spectrum Global',3),
    createData('Gingerbread', 35, '123456789', 'example@gmail.com', 'spectrum Global',4),
    createData('Honeycomb', 40, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createData('Ice cream sandwich', 55, '123456789', 'example@gmail.com', 'spectrum Global',6),
    createData('Jelly Bean', 4, '123456789', 'example@gmail.com','spectrum Global',5),
    createData('KitKat', 42, '123456789', 'example@gmail.com', 'spectrum',5),
    createData('Lollipop', 27, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createData('Marshmallow', 3,'123456789', 'example@gmail.com', 'spectrum', 'spectrum Global',5),
    createData('Nougat', 28, '123456789', 'example@gmail.com', 'spectrum Global',5),
    createData('Oreo', 29, '123456789', 'example@gmail.com', 'spectrum Global',5),
  ];

const columns = [
    { key_id: 'organizer', numeric: false, disablePadding: true, label: 'Organizer', sortFlag:true },
    { key_id: 'company',  numeric: true, disablePadding: false, label: 'Company', sortFlag:true },
    { key_id: 'about', numeric: true, disablePadding: false, label: 'About', sortFlag:false },
    { key_id: 'scheduledfor', numeric: false, disablePadding: false, label: 'Scheduled For', sortFlag:false },
    { key_id: 'duration', numeric: false, disablePadding: false, label: 'Duration', sortFlag:false },
    { key_id: 'capacity', numeric: true, disablePadding: false, label: 'Capacity', sortFlag:false}
  ];


function Eventtable(){
    const tableTitle="Event List";
    return (
        <React.Fragment>            
            <TableWidget 
              rows={rows} 
              defaultSort='name'
              columns={columns}
              tableTitle={tableTitle}            
            />
        </React.Fragment>
    );
}

export default Eventtable;
